import React, { useState } from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import logo from '../../logo.svg';

const User = (props) => {
    console.log(props.user.id);
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="card-group mx-auto">
                        <div className="card text-center" style={{ width: '20rem' }}>
                            <img className="card-img-top" src={logo} alt="" />
                            <div className="card-body">
                                <h4 className="card-title">Shahin Mahmud</h4>
                                <button className="btn btn-primary">Add Friend</button>
                            </div>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item">email: ahmshahin5353@gmail.com</li>
                                <li className="list-group-item">Yearly Income : $500000</li>
                            </ul>
                            <p className="card-text">Address:
                                <small>
                                    street: 554ssdf shys
                                </small>
                            </p>
                        </div>
                       
                </div>
            </div>
        </div>
    );
};

export default User;
